import React from 'react';

// Example Component
const Example = (props) => {
  return <h1>{props.details}</h1>;
};

// PersonalInfo Component
const PersonalInfo = (props) => {
  return (
    <div>
      <p>Name: {props.name}</p>
      <p>Age: {props.age}</p>
      <p>Occupation: {props.occupation}</p>
    </div>
  );
};

// Summary Component
const Summary = (props) => {
  return (
    <div>
      <Example details={props.exampleDetails} />
      <PersonalInfo 
        name={props.personalInfo.name} 
        age={props.personalInfo.age} 
        occupation={props.personalInfo.occupation} 
      />
    </div>
  );
};

// App Component
function App() {
  const personalInfo = {
    name: "John Doe",
    age: 30,
    occupation: "Software Developer"
  };

  return (
    <div>

      <Example details="" />


      <PersonalInfo name="Jane Doe" age={28} occupation="Designer" />

      <Summary 
        exampleDetails="Matimba" 
        personalInfo={personalInfo} 
      />
    </div>
  );
}

export default App;
